        <img src={main} alt='job hunt' className='img main-img'/>
    </div>
  </Wrapper>
  )
}

const Wrapper = styled.main `
 nav {
    width: var(--fluid-width);
    max-width: var(--max-width);
    margin: 0 auto;
    height: var(--nav-height);
    display: flex;
    align-items: center;
 }
`

export default Landing
